import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            ruleNames: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:9000/kings")
            .then(res => res.json())
            .then((data) => {
                console.log(data)
                console.log(typeof Object.keys(data));
                this.setState({ ruleNames: Object.values(data) });
            })
            .catch(console.log)
    }

    componentWillUnmount() {
    }

    render() {
        return (
            <div className="App">
                <ul>{this.state.ruleNames}</ul>
            </div>
        );
    }
}

export default App;
